import React, { useEffect, useState } from "react";
import {
  Table,
  TableHead,
  TableBody,
  TableCell,
  TableRow,
} from "@mui/material";

const Vendor = ({ product }) => {
  const [vendorVariants, setVendorVariants] = useState([]);

  useEffect(() => {
    const vendorVariants = product.vendors.map((vendor) => ({
      vendorName: vendor.nameV,
      variants: vendor.variants,
    }));
    setVendorVariants(vendorVariants);
  }, [product.vendors]);

  return (
    <div className="vendor-detail">
      <Table>
        <TableHead>
          <TableRow>
            {vendorVariants.map((vendor, index) => (
              <TableCell key={index}>{vendor.vendorName}</TableCell>
            ))}
          </TableRow>
        </TableHead>
        <TableBody>
          <TableRow>
            {vendorVariants.map((vendor, index) => (
              <TableCell key={index}>
                {vendor.variants.map((variant, variantIndex) => (
                  <div key={variantIndex}>
                    {Object.entries(variant).map(([key, value]) => (
                      <div key={key}>{`${key} : ${value}`}</div>
                    ))}
                  </div>
                ))}
              </TableCell>
            ))}
          </TableRow>
        </TableBody>
      </Table>
    </div>
  );
};

export default Vendor;
